import Root from "./components/root";

import {
  RouteProvider,
  createHashRouter,
  createRoutesFromElements,
  Route,
} from "react-router-dom";

const appRouter = <Route path="/" element=""/>;

function App() {
  return <RouteProvider router={appRouter} />;
}
export default App;
